import React from 'react'
import Navbar from '../navbar';
import Tours from '../tours';
import Footer from '../footer';
const Holiday = () => {
    return (
        <div>
            <Navbar /> 
            <Tours />
            <Footer />
        </div>
    )
}

export default Holiday
